import React from "react";
import "./Home.css";
import Navbar from "../../Components/Navbar/Navbar";
import Sidebar from "../../Components/Sidebar/Sidebar";

function Home() {
  const elements = [
    {
      text: "Home",
      icon: "uil uil-home",
    },
    {
      text: "Explore",
      icon: "uil uil-compass",
    },
    {
      text: "Home",
      icon: "uil uil-home",
    },
    {
      text: "Home",
      icon: "uil uil-home",
    },
    {
      text: "Home",
      icon: "uil uil-home",
    },
  ];
  return (
    <div>
      <Navbar />
      <Sidebar elements={elements} />
    </div>
  );
}

export default Home;
